import { useFetch } from "Hooks/useFetch";
import { useEffect } from "react";

const App = () => {
  const { data, loading, error } = useFetch(
    "https://api.themoviedb.org/3/trending/movie/week?api_key=9483b1dc2a9ab631567764498b358b6c"
  );

  useEffect(() => {
    if (!loading) {
      console.log("data: ", data);
      data.results.map((movie) => {
        console.log(movie);
      });
    }
  }, [data]);

  return (
    <>
      {loading ? (
        <>Loading</>
      ) : (
        <>
          <ul>
            {data.results.map((movie) => {
              return <li>{JSON.stringify(movie.title)}</li>;
            })}
          </ul>
        </>
      )}
      ;
    </>
  );
};

export default App;
